// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { CssBaseline, Container } from '@mui/material';
import { AlertProvider } from './context/alertContext';
import { AuthProvider } from './context/authContext';
import { SocketProvider } from './context/socketContext';
import AlertBar from './components/AlertBar';

// Pages
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Dashboard from './pages/Dashboard';
import TrackOrder from './pages/TrackOrder';
import Garments from './pages/Garments';
import AdminDashboard from './pages/admin/AdminDashboard';
import NotFound from './pages/NotFound'; // comment out if file doesn't exist

// Layout
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import NewOrder from './pages/NewOrder'; // âœ… Add this



<Routes>
  <Route path="/" element={<Home />} />
  <Route path="/login" element={<Login />} />
  <Route path="/dashboard" element={<Dashboard />} />
  <Route path="/track" element={<TrackOrder />} />
  <Route path="/garments" element={<Garments />} />
  <Route path="/admin/dashboard" element={<AdminDashboard />} />
  <Route path="/register" element={<Register />} />
  <Route path="/order/new" element={<NewOrder />} /> {/* âœ… Add this */}
  <Route path="*" element={<NotFound />} /> {/* Optional catch-all */}
</Routes>


function App() {
  return (
    <Router>
      <AuthProvider>
        <SocketProvider>
          <AlertProvider>
            <CssBaseline />
            <Navbar />
            <Container sx={{ mt: 4, mb: 4 }}>
              <AlertBar />
              <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/login" element={<Login />} />
                <Route path="/register" element={<Register />} />
                <Route path="/dashboard" element={<Dashboard />} />
                <Route path="/track" element={<TrackOrder />} />
                <Route path="/garments" element={<Garments />} />
                <Route path="/admin/dashboard" element={<AdminDashboard />} />
                <Route path="*" element={<NotFound />} /> {/* Catch-all */}
              </Routes>
            </Container>
            <Footer />
          </AlertProvider>
        </SocketProvider>
      </AuthProvider>
    </Router>
  );
}

export default App;
